import React from 'react';
import {Link} from 'react-router-dom';

export const Nav=()=>(
    <nav>
        <ul>
            <li>
                <Link to="/" >Home</Link>
            </li>
            <li>
                <Link to="/About">About</Link>
            </li>
        </ul>
    </nav>
);
